import React, {Component} from 'react'
import Nav from '../components/organisms/Nav'

export default class User extends Comonent {

    constructor (props) {
        super (props)
    }

    render () {
        return (
            <div className='user'>
                <Nav />
                <h1>ユーザー</h1>
            </div>
        )
    }
}
